import React from 'react'

const Profile = (currentUser) => {
  return (
    <div className='p-3 max-w-lg mx-auto'>
      <h1 className='text-3xl font-semibold text-center my-7'>Profile</h1>
      <form className=''>
        <img src={currentUser.avatar || '/assets/avatar.png'} alt='profile' className='rounded-full h-24 w-24 object-cover cursor-pointer self-center mt-2'/>
        <input type='text' placeholder='username' defaultValue={currentUser.username} className='bg-slate-100 p-2 rounded-lg w-full mt-3 focus:outline-none'/>
      </form>
    </div>
  )
}

export default Profile
